function genPDF(n,i,t,e,r,o,p,d){const b=new jsPDF,m=`\n        <!DOCTYPE html>\n        <html>\n            <body>\n                <h1>Indice de fragilité</h1>\n                <p id="ignorePDF">don't print this to pdf</p>\n                <div>\n                    <p>Information pour la commune : <b>${n.toString()}</b></p>\n                    <p>Indice de fragilité : <b>${i.toString()}</b></p>\n                    <p>Indice de fragilité moyen du département: <b>${t.toString()}</b></p>\n                    <p>Indice de fragilité moyen de la région: <b>${e.toString()}</b></p>\n                    <p>Indice de fragilité moyen du département: <b>${t.toString()}</b></p>\n                    <br><br>\n                    <p>Accès aux interface numérique: <b>${d.toString()}</b></p>\n                    <p>Accès à l'information: <b>${p.toString()}</b> </p>\n                    <p>Compétences numérique/scolaire: <b>${o.toString()}</b></p>\n                    <p>Compétences administrative: <b>${r.toString()}</b></p>\n                </div>\n            </body>\n        </html>\n    `;b.fromHTML(m,15,15,{width:180,elementHandlers:{"#ignorePDF":function(n,i){return!0}}}),b.save("indice_fragilite_commune_"+n.toString()+".pdf")}